import { Component, Input } from '@angular/core';
import { EnvioDeDatosService } from 'src/app/envio-de-datos.service';

@Component({
  selector: 'app-component',
  templateUrl: './component.component.html',
  styleUrls: ['./component.component.css']
})

export class ComponentComponent {
  @Input () Nombre:any= " ";
  @Input () Apellido:any= " ";
  @Input () Email:any= " ";
  @Input () Contrasena :any= " ";
  @Input () Confirmar:any= " ";
  @Input () Telefono:any= " ";

almacenar ()
{
 localStorage.setItem('Valor', this.Nombre)
 localStorage.setItem('Valor ', this.Apellido)
 localStorage.setItem('Valor ', this.Email)
 localStorage.setItem('Valor ', this.Contrasena)
 localStorage.setItem('Valor ', this.Telefono)
}

Imprimir ()
{
  //this.Envio.Disparador.emit({data: this.dataentrarte})
}

Mostrar ()
{
localStorage.getItem ('Valor  ')
}

constructor ( private Envio: EnvioDeDatosService) {}

}



<body  style="text-align: center;"> 

    <h4> Formulario </h4>

        <section style="text-align: center;">

            <p> Nombres: 
                <input class="Controles"  [(ngModel)]="Nombre"  type="text" name="Nombres" id="nombres" placeholder="Ingrese su Nombres" >

                <br>

            </p>

            <p> Apellidos:
                <input   class="Controles"[(ngModel)]="Apellido" type="text" name="Nombres" id="nombres" placeholder="Ingrese sus Apellidos" >
            <br>
            </p>

            <p> Email:
                <input  class="Controles" [(ngModel)]="Email" type="text" name="Nombres" id="nombres" placeholder="Ingrese su dirreccio de Email" >
            <br>
            </p>

            <p> Contraseña:
                <input  class="Controles"  [(ngModel)]="Contrasena" type="text" name="Nombres" id="nombres" placeholder="Ingrese su Contraseña" >
            <br>
            </p>

            <p> Confirmar:
                <input  class="Controles"  [(ngModel)]="Confirmar" type="text" name="Nombres" id="nombres" placeholder="Confirme su contraseña" >
            <br>
            </p>

            <p> Telefono:
                <input  class="Controles" [(ngModel)]="Telefono" type="text" name="Nombres" id="nombres" placeholder="Ingrese su Telefono" >
            <br>
            </p>
            <button (click)= "Imprimir ()"> Imprimir </button>

            <button (click)= "almacenar()"  [routerLink]="['home']">  Almacenar</button>


        </section>

</body>
